import React from "react";
import "./index.css";

function App() {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-200">
      <h1 className="text-4xl font-bold text-blue-500">Hello, World!</h1>
    </div>
  );
}

export default App;
